import React from "react";

const Intro = () => {
  return (
    <div>
      <div id="intro" className="basic-1">
        <div className="container">
          <div className="row">
            <div className="col-lg-5">
              <div className="text-container">
                <div className="section-title">INTRO</div>
                <h2>
                  It is a long established fact that a reader will be distracted
                  by the
                </h2>
                <p>
                  it look like readable English. Many desktop publishing
                  packages and web page editors now use Lorem Ipsum as their
                  default model text, and a search for 'lorem ipsum'
                </p>
                <p className="testimonial-text">
                  will uncover many web sites still in their infancy. Various
                  versions have evolved over the years, sometimes by accident,
                  sometimes on purpose (injected humour and the like).
                </p>
                <div className="testimonial-author">Rakib Islam - CEO</div>
              </div>{" "}
              {/* end of text-container */}
            </div>{" "}
            {/* end of col */}
            <div className="col-lg-7">
              <div className="image-container">
                <img
                  className="img-fluid"
                  src="assets/images/intro-office.jpg"
                  alt="alternative"
                />
              </div>{" "}
            </div>{" "}
          </div>{" "}
        </div>{" "}
      </div>{" "}
    </div>
  );
};

export default Intro;
